import './App.css';
import Navbar from './components/Navbar';
import { Home } from './components/Home';
import About from './components/About';

function App() {
  return (
    <>
    <Routes>
         <Route path="/" element={<Home />} />
         <Route exact path="/about" element={<About />} />
  </Routes>
  </>
  );
}

export default App;
